import React, { useState } from "react";

export default function SkillSearch({ onSearch }) {
  const [skill, setSkill] = useState("");

  return (
    <div>
      <input 
        type="text" 
        value={skill} 
        onChange={e => setSkill(e.target.value)} 
        placeholder="Search by skill"
      />
      <button onClick={() => onSearch(skill)}>Search</button>
    </div>
  );
}
